const subheadingsData = {
  1: [
    {
      title: "Sobre mi",
      content: (
        <>
          <p>
          Me atrae la belleza y las cosas bonitas que motivan cada día y te hacen reflexionar sobre todo. 
          Apasionada por crear y desarrolar contenido nuevo que impresionen a las personas. <br/>
          Mobile-first. Me gusta empezar diseñando primero para pantallas móviles para, posteriormente, continuar aumentando el tamaño de pantalla, ya que en la actualidad se utilizan más los dispositivos móviles.
          </p>
        </>
      ),
    },
  ],
  2: [
    {
      title: "Diseño gráfico y diseño UX",
      content: (
        <>
          <p>
          - Técnico Superior en Diseño y Producción editorial. <br/>
          - Certificado en Diseño de Experiencia del Usuario (UX) de Google. <br/>
          </p>
        </>
      ),
    },
    {
      title: "Programación y desarrollo web",
      content: (
        <>
          <p>
          - Certificado en diseño web y multimedia. <br/>
          - Certificado en JavaScript avanzado. <br/> 
          - Certificado en Java SE 8 (Oracle).
          </p>
        </>
      ),
    },
    {
      title: "Inteligencia Artificial",
      content: (
          <>
              <p>
              Certificado Introducción a la inteligencia artificial y los algoritmos.
              </p>
          </>
      ),
  },
  ],
  3: [
    {
      title: "Freelance",
      content: (
        <>
          <p>
            Creación de páginas web, carteles, logotipos, etc. para terceras personas y concursos.
          </p>
        </>
      ),
    },
    {
      title: "La Voz de Asturias (Grupo Zeta)",
      content: (
        <>
          <p>
          Diseño gráfico, infografía, tratamiento de texto e imágenes y maquetación.
          </p>
        </>
      ),
    },
    {
      title: "Publiplux",
      content: (
        <>
          <p>
          Diseño para todo tipo de formatos, desde serigrafía para la estampación de textiles 
          hasta tampografía para la impresión en materiales sólidos resistentes.
          </p>
        </>
      ),
    },
  ],
};

export default subheadingsData;
